import ExpenseItem from './ExpenseItem';
import './Expense.css';

function Expenses(props) {

  return (
    <div className="expenses">
      {
        props.data.forEach(function (values) {
          <ExpenseItem title={values.title} amount={values.amount} data={values.date} />
        })
        /* <ExpenseItem title={props.data[0].title} amount={props.data[0].amount} date={props.data[0].date}></ExpenseItem>
